// 1 valence mass 2 sea mass *****************************************

double mv1s2nf3p4(const quarkmassnf mass, const Linf Liin){
  return mv1s2nf3p4L(mass,Liin)+mv1s2nf3p4R(mass);
}

double mv1s2nf3p4L(const quarkmassnf mass, const Linf Liin){
  double L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu;
  int nfLi;
  Liin.out(L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu,nfLi);
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if (mu0 != mu){
    cout << "ERROR: differing mu's in mv1s2nf3p4L\n";}
  if ( (nq != 3) || (B0mq.size() != 3)){
    cout << "ERROR: mv1s2nf3p4L probably called with wrong number"
	 << "of quark masses\n";}
  // three masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m66 = 2.*B0mq[2];
  double M12p4x12L =
       + 16*m11*m66*L6r - 8*m11*m66*L4r + 32*m11*m44*L6r - 16*m11*m44*
         L4r + 16*pow(m11,2)*L8r - 8*pow(m11,2)*L5r;

  return M12p4x12L/pow(f0,2);
}

double mv1s2nf3p4R(const quarkmassnf mass){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 3) || (B0mq.size() != 3)){
    cout << "ERROR: mv1s2nf3p4R probably called with wrong number"
	 << "of quark masses\n";}
  // three masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m66 = 2.*B0mq[2];
  double me2 = (m44+2.*m66)/3.;
  double mu2 = mu0*mu0;
  double RC146e = RC(m11,m44,m66,me2);
  double RSe6611 = pow(RS(me2,m66,m11),2);
  double RD146e = RD(m11,m44,m66,me2);
  double M12p4x12R =
       + Ab(m11,mu2) * (  - 1./3.*m11*RC146e );

      M12p4x12R +=  + Ab(me2,mu2) * ( 2./3.*m11*RSe6611 );

      M12p4x12R +=  + Bb(m11,mu2) * (  - 1./3.*m11*RD146e );

  return M12p4x12R/pow(f0,2);
}

double mv1s2nf3p6(const quarkmassnf mass, const Linf Liin, const Ki Kiin){
  return mv1s2nf3p6L(mass,Liin)+mv1s2nf3p6K(mass,Kiin)+mv1s2nf3p6R(mass);
}

