// 1 valence mass 3 sea mass *****************************************
double mv1s3nf3p4(const quarkmassnf mass, const Linf Liin){
  return mv1s3nf3p4L(mass,Liin)+mv1s3nf3p4R(mass);
}

double mv1s3nf3p4L(const quarkmassnf mass, const Linf Liin){
  double L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu;
  int nfLi;
  Liin.out(L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu,nfLi);
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if (mu0 != mu){
    cout << "ERROR: differing mu's in mv1s3nf3p4L\n";}
  if ( (nq != 4) || (B0mq.size() != 4)){
    cout << "ERROR: mv1s3nf3p4L probably called with wrong number"
	 << "of quark masses\n";}
  // four masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m55 = 2.*B0mq[2];
  double m66 = 2.*B0mq[3];
  double M12p4x13L =
       + 16*m11*m66*L6r - 8*m11*m66*L4r + 16*m11*m55*L6r - 8*m11*m55*
         L4r + 16*m11*m44*L6r - 8*m11*m44*L4r + 16*pow(m11,2)*L8r - 8*
         pow(m11,2)*L5r;

  return M12p4x13L/pow(f0,2);
}


double mv1s3nf3p4R(const quarkmassnf mass){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 4) || (B0mq.size() != 4)){
    cout << "ERROR: mv2s3nf3p4R probably called with wrong number"
	 << "of quark masses\n";}
  // four masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m55 = 2.*B0mq[2];
  double m66 = 2.*B0mq[3];
  double xb1 = (m44+m55+m66)/3.;
  double msqr = sqrt(xb1*xb1-(m44*m55+m44*m66+m55*m66)/3.);
  double mp2 = xb1-msqr; 
  double me2 = xb1+msqr;

  double mu2 = mu0*mu0;
  double RD1456ep = RD(m11,m44,m55,m66,me2,mp2);
  double RC1456pe = RC(m11,m44,m55,m66,mp2,me2);  
  double RSe45611p = RS(me2,m44,m55,m66,m11,m11,mp2);
  double RSp45611e = RS(mp2,m44,m55,m66,m11,m11,me2);

  double M12p4x13R =
       + Ab(m11,mu2) * (  - 1./3.*m11*RC1456pe );

      M12p4x13R +=  + Ab(me2,mu2) * (  - 1./3.*m11*RSe45611p );

      M12p4x13R +=  + Ab(mp2,mu2) * (  - 1./3.*m11*RSp45611e );

      M12p4x13R +=  + Bb(m11,mu2) * (  - 1./3.*m11*RD1456ep );

  return M12p4x13R/pow(f0,2);
}

