// 1 valence mass 1 sea mass *****************************************

double fv1s1nf3p4(const quarkmassnf mass, const Linf Liin){
  return fv1s1nf3p4L(mass,Liin)+fv1s1nf3p4R(mass);
}

double fv1s1nf3p4L(const quarkmassnf mass, const Linf Liin){
  double L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu;
  int nfLi;
  Liin.out(L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu,nfLi);
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if (mu0 != mu){
    cout << "ERROR: differing mu's in fv1s1nf3p4L\n";}
  if ( (nq != 2) || (B0mq.size() != 2)){
    cout << "ERROR: fv1s1nf3p4L probably called with wrong number"
	 << "of quark masses\n";}
  // two masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double F12p4x11L =
       + 12*m44*L4r + 4*m11*L5r;

  return F12p4x11L/pow(f0,2);
}


double fv1s1nf3p4R(const quarkmassnf mass){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 2) || (B0mq.size() != 2)){
    cout << "ERROR: fv2s1nf3p4R probably called with wrong number"
	 << "of quark masses\n";}
  // two masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m14 = (m11+m44)/2.;
  double mu2 = mu0*mu0;
  double F12p4x11R =
       + Ab(m14,mu2) * ( 3./2. );

  return F12p4x11R/pow(f0,2);
}

double fv1s1nf3p6(const quarkmassnf mass, const Linf Liin, const Ki Kiin){
  return fv1s1nf3p6L(mass,Liin)+fv1s1nf3p6K(mass,Kiin)+fv1s1nf3p6R(mass);
}

double fv1s1nf3p6L(const quarkmassnf mass, const Linf Liin){
  double L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu;
  int nfLi;
  Liin.out(L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu,nfLi);
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if (mu0 != mu){
    cout << "ERROR: differing mu's in fv1s1nf3p6L\n";}
  if ( (nq != 2) || (B0mq.size() != 2)){
    cout << "ERROR: fv1s1nf3p6L probably called with wrong number"
	 << "of quark masses\n";}
  // two masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m14 = (m11+m44)/2.;
  double mu2 = mu0*mu0;
  double F12p6x11L =
       + pi16 * (  - 3./4.*pow(m44,2)*L3r - 8*pow(m44,2)*L2r - 3./2.*
         pow(m44,2)*L0r - 17./6.*m11*m44*L3r - 13./3.*m11*m44*L0r + 5./
         4.*pow(m11,2)*L3r - pow(m11,2)*L2r - 2*pow(m11,2)*L1r + 1./2.*
         pow(m11,2)*L0r );

      F12p6x11L +=  + Ab(m11,mu2) * (  - 4*m44*L3r - 4*m44*L0r - 4./3.*
         m11*L5r + 8*m11*L3r - 10*m11*L2r - 4*m11*L1r + 8*m11*L0r );

      F12p6x11L +=  + Ab(m14,mu2) * (  - 18*m44*L4r - 30*m14*L3r - 12*
         m14*L0r + 6*m11*L5r );

      F12p6x11L +=  + Ab(m44,mu2) * ( 32*m44*L4r - 16*m44*L2r - 64*m44*
         L1r );

      F12p6x11L +=  + Bb(m11,mu2) * ( 4./3.*m11*m44*L5r - 4*m11*m44*L3r
          - 4*m11*m44*L0r - 4./3.*pow(m11,2)*L5r + 4*pow(m11,2)*L3r + 4
         *pow(m11,2)*L0r );

      F12p6x11L +=  + Bb(m14,mu2) * ( 72*m14*m44*L6r - 36*m14*m44*L4r
          + 24*pow(m14,2)*L8r - 12*pow(m14,2)*L5r );

      F12p6x11L +=  - 72*pow(m44,2)*pow(L4r,2) - 48*m11*m44*L4r*L5r - 8
         *pow(m11,2)*pow(L5r,2);

  return F12p6x11L/pow(f0,4);
}

double fv1s1nf3p6K(const quarkmassnf mass, const Ki Kiin){
  double KK[116],mu;
  Kiin.out(KK,mu);
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if (mu0 != mu){
    cout << "ERROR: differing mu's in fv1s1nf3p6L\n";}
  if ( (nq != 2) || (B0mq.size() != 2)){
    cout << "ERROR: fv1s1nf3p6K probably called with wrong number"
	 << "of quark masses\n";}
  // two masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double F12p6x11K =
       + 8*KK[19]*pow(m11,2) + 24*KK[20]*m11*m44 + 24*KK[21]*pow(m44,2)
          + 72*KK[22]*pow(m44,2) + 8*KK[23]*pow(m11,2);

  return F12p6x11K/pow(f0,4);
}

double fv1s1nf3p6R(const quarkmassnf mass){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 2) || (B0mq.size() != 2)){
    cout << "ERROR: fv1s1nf3p6R probably called with wrong number"
	 << "of quark masses\n";}
  // two masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m14 = (m11+m44)/2.;
  double mu2 = mu0*mu0;

  double F12p6x11R =
       + pi162 * (  - 9./128.*pow(m44,2) + 9./8.*m14*m44 - 3./8.*m11*
         m44 - 3./64.*pow(m11,2) + 1./12.*pi2*pow(m44,2) + 3./16.*pi2*
         m14*m44 + 1./48.*pi2*m11*m44 - 1./96.*pi2*pow(m11,2) );

      F12p6x11R +=  + pow(Ab(m11,mu2),2) * ( 1./16. );

      F12p6x11R +=  + Ab(m11,mu2)*Bb(m11,mu2) * ( 1./8.*m44 - 1./8.*m11
          );

      F12p6x11R +=  + Ab(m11,mu2)*Bb(m14,mu2) * (  - 1./2.*m14 );

      F12p6x11R +=  + Ab(m14,mu2)*pi16 * (  - 3./2.*m44 - 3./8.*m11 );

      F12p6x11R +=  + pow(Ab(m14,mu2),2) * ( 9./8.*pow(m14,-1)*m44 );

      F12p6x11R +=  + pow(Ab(m44,mu2),2) * ( 1./2. );

      F12p6x11R +=  + hh(1,m11,m14,m14,m11,mu2) * (  - 1./8.*m44 );

      F12p6x11R +=  + hh(1,m14,m14,m44,m11,mu2) * (  - m44 );

      F12p6x11R +=  + hh(2,m11,m14,m14,m11,mu2) * (  - 1./8.*m11*m44 + 
         1./8.*pow(m11,2) );

      F12p6x11R +=  + hhd(1,m11,m11,m11,m11,mu2) * ( 5./18.*pow(m11,2)
          );

      F12p6x11R +=  + hhd(1,m11,m14,m14,m11,mu2) * ( 1./8.*m11*m44 - 1./
         2.*pow(m11,2) );

      F12p6x11R +=  + hhd(1,m14,m14,m44,m11,mu2) * ( m11*m44 );

      F12p6x11R +=  + hhd(2,m11,m11,m11,m11,mu2) * (  - 2./9.*pow(
         m11,2)*m44 + 2./9.*pow(m11,3) );

      F12p6x11R +=  + hhd(2,m11,m14,m14,m11,mu2) * (  - 3./8.*pow(
         m11,2)*m44 + 3./8.*pow(m11,3) );

      F12p6x11R +=  + hhd(5,m11,m11,m11,m11,mu2) * ( 1./9.*pow(m11,2)*
         pow(m44,2) - 2./9.*pow(m11,3)*m44 + 1./9.*pow(m11,4) );

      F12p6x11R +=  + hh1d(3,m14,m11,m14,m11,mu2) * ( 2*pow(m11,2)*m44
          - 2*pow(m11,3) );

      F12p6x11R +=  + hh21d(1,m11,m14,m14,m11,mu2) * ( 3./8.*pow(m11,2)
          );

      F12p6x11R +=  + hh21d(1,m44,m14,m14,m11,mu2) * ( 3*pow(m11,2) );

      F12p6x11R +=  + hh21d(2,m11,m14,m14,m11,mu2) * ( 3./8.*pow(m11,2)
         *m44 - 3./8.*pow(m11,3) );

  return F12p6x11R/pow(f0,4);
}
