      F13p6x21R +=  + hh(1,m11,m13,m33,m13,mu2) * (  - 1./36.*m44 + 1./
         144.*m33 + 5./144.*m11 + 1./36.*RS(m11,m44,m33)*m44 - 1./12.*
         RS(m11,m44,m33)*m11 + 1./18.*pow(RS(m11,m44,m33),2)*m11 );

      F13p6x21R +=  + hh(1,m11,m14,m34,m13,mu2) * ( 1./16.*m33 - 1./16.
         *m11 - 1./8.*RS(m11,m44,m33)*m44 );

      F13p6x21R +=  + hh(1,m13,m13,m13,m13,mu2) * (  - 1./8.*m13 );

      F13p6x21R +=  + hh(1,m13,m33,m33,m13,mu2) * ( 1./72.*m44 + 13./
         144.*m33 - 7./144.*m11 - 1./72.*RS(m11,m44,m33)*m44 + 1./24.*
         RS(m11,m44,m33)*m11 - 1./36.*pow(RS(m11,m44,m33),2)*m11 );

      F13p6x21R +=  + hh(1,m14,m33,m34,m13,mu2) * (  - 1./8.*m44 - 1./
         16.*m33 + 1./16.*m11 + 1./8.*RS(m11,m44,m33)*m44 );

      F13p6x21R +=  + hh(1,m14,m34,m44,m13,mu2) * (  - m44 );

      F13p6x21R +=  + hh(2,m11,m11,m13,m13,mu2) * (  - 1./72.*m13*RD14
          + 1./36.*RS(m11,m44,m33)*m13*RD14 );

      F13p6x21R +=  + hh(2,m11,m13,m33,m13,mu2) * ( 1./72.*m13*RD14 - 1.
         /36.*RS(m11,m44,m33)*m13*RD14 );

      F13p6x21R +=  + hh(2,m11,m14,m34,m13,mu2) * ( 1./8.*m14*RD14 );

