// 1 valence mass 3 sea mass *****************************************
double fv1s3nf3p4(const quarkmassnf mass, const Linf Liin){
  return fv1s3nf3p4L(mass,Liin)+fv1s3nf3p4R(mass);
}

double fv1s3nf3p4L(const quarkmassnf mass, const Linf Liin){
  double L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu;
  int nfLi;
  Liin.out(L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu,nfLi);
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if (mu0 != mu){
    cout << "ERROR: differing mu's in fv1s3nf3p4L\n";}
  if ( (nq != 4) || (B0mq.size() != 4)){
    cout << "ERROR: fv1s3nf3p4L probably called with wrong number"
	 << "of quark masses\n";}
  // four masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m55 = 2.*B0mq[2];
  double m66 = 2.*B0mq[3];
  double F12p4x13L =
       + 4*m66*L4r + 4*m55*L4r + 4*m44*L4r + 4*m11*L5r;

  return F12p4x13L/pow(f0,2);
}


double fv1s3nf3p4R(const quarkmassnf mass){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 4) || (B0mq.size() != 4)){
    cout << "ERROR: fv2s3nf3p4R probably called with wrong number"
	 << "of quark masses\n";}
  // four masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m55 = 2.*B0mq[2];
  double m66 = 2.*B0mq[3];
  double m14 = (m11+m44)/2;
  double m15 = (m11+m55)/2;
  double m16 = (m11+m66)/2;

  double mu2 = mu0*mu0;

  double F12p4x13R =
       + Ab(m14,mu2) * ( 1./2. );

      F12p4x13R +=  + Ab(m15,mu2) * ( 1./2. );

      F12p4x13R +=  + Ab(m16,mu2) * ( 1./2. );

  return F12p4x13R/pow(f0,2);
}

double fv1s3nf3p6(const quarkmassnf mass, const Linf Liin, const Ki Kiin){
  return fv1s3nf3p6L(mass,Liin)+fv1s3nf3p6K(mass,Kiin)+fv1s3nf3p6R(mass);
}

