double fv1s3nf3p6K(const quarkmassnf mass, const Ki Kiin){
  double KK[116],mu;
  Kiin.out(KK,mu);
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if (mu0 != mu){
    cout << "ERROR: differing mu's in fv1s3nf3p6L\n";}
  if ( (nq != 4) || (B0mq.size() != 4)){
    cout << "ERROR: fv1s3nf3p6K probably called with wrong number"
	 << "of quark masses\n";}
  // four masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m44 = 2.*B0mq[1];
  double m55 = 2.*B0mq[2];
  double m66 = 2.*B0mq[3];

  double F12p6x13K =
       + KK[19] * ( 8*pow(m11,2) );

      F12p6x13K +=  + KK[20] * ( 8*m11*m66 + 8*m11*m55 + 8*m11*m44 );

      F12p6x13K +=  + KK[21] * ( 8*pow(m66,2) + 8*pow(m55,2) + 8*pow(
         m44,2) );

      F12p6x13K +=  + KK[22] * ( 8*pow(m66,2) + 16*m55*m66 + 8*pow(
         m55,2) + 16*m44*m66 + 16*m44*m55 + 8*pow(m44,2) );

      F12p6x13K +=  + KK[23] * ( 8*pow(m11,2) );

  return F12p6x13K/pow(f0,4);
}

