double fv2s3nf3p4(const quarkmassnf mass, const Linf Liin){
  return fv2s3nf3p4L(mass,Liin)+fv2s3nf3p4R(mass);
}

double fv2s3nf3p4L(const quarkmassnf mass, const Linf Liin){
  double L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu;
  int nfLi;
  Liin.out(L0r,L1r,L2r,L3r,L4r,L5r,L6r,L7r,L8r,L9r,L10r,L11r,H1r,H2r,mu,nfLi);
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if (mu0 != mu){
    cout << "ERROR: differing mu's in fv2s3nf3p4L\n";}
  if ( (nq != 5) || (B0mq.size() != 5)){
    cout << "ERROR: fv2s3nf3p4L probably called with wrong number"
	 << "of quark masses\n";}
  // two masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m33 = 2.*B0mq[1];
  double m44 = 2.*B0mq[2];
  double m55 = 2.*B0mq[3];
  double m66 = 2.*B0mq[4];

  double F13p4x23L =
       + 4*m66*L4r + 4*m55*L4r + 4*m44*L4r + 2*m33*L5r + 2*m11*L5r;

  return F13p4x23L/pow(f0,2);
}


double fv2s3nf3p4R(const quarkmassnf mass){
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if ( (nq != 5) || (B0mq.size() != 5)){
    cout << "ERROR: fv2s3nf3p4R probably called with wrong number"
	 << "of quark masses\n";}
  // five masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m33 = 2.*B0mq[1];
  double m44 = 2.*B0mq[2];
  double m55 = 2.*B0mq[3];
  double m66 = 2.*B0mq[4];
  double m14 = (m11+m44)/2;
  double m15 = (m11+m55)/2;
  double m16 = (m11+m66)/2;
  double m34 = (m33+m44)/2;
  double m35 = (m33+m55)/2;
  double m36 = (m33+m66)/2;

  double xb1 = (m44+m55+m66)/3.;
  double msqr = sqrt(xb1*xb1-(m44*m55+m44*m66+m55*m66)/3.);
  double mp2 = xb1-msqr; 
  double me2 = xb1+msqr;
  double mu2 = mu0*mu0;
  double RSe45611p = RS(me2,m44,m55,m66,m11,m11,mp2);
  double RSp45611e = RS(mp2,m44,m55,m66,m11,m11,me2);
  double RSe45613p = RS(me2,m44,m55,m66,m11,m33,mp2);
  double RSp45613e = RS(mp2,m44,m55,m66,m11,m33,me2);
  double RSe45633p = RS(me2,m44,m55,m66,m33,m33,mp2);
  double RSp45633e = RS(mp2,m44,m55,m66,m33,m33,me2);
  double RS14563pe = RS(m11,m44,m55,m66,m33,mp2,me2);
  double RS34561pe = RS(m33,m44,m55,m66,m11,mp2,me2);

  double RC1456pe = RC(m11,m44,m55,m66,mp2,me2);
  double RC3456pe = RC(m33,m44,m55,m66,mp2,me2);
  double RD1456ep = RD(m11,m44,m55,m66,me2,mp2);
  double RD3456ep = RD(m33,m44,m55,m66,me2,mp2);

  double F13p4x23R =
       + Ab(m11,mu2) * ( 1./6.*RS14563pe - 1./12.*RC1456pe );

      F13p4x23R +=  + Ab(m14,mu2) * ( 1./4. );

      F13p4x23R +=  + Ab(m15,mu2) * ( 1./4. );

      F13p4x23R +=  + Ab(m16,mu2) * ( 1./4. );

      F13p4x23R +=  + Ab(m33,mu2) * ( 1./6.*RS34561pe - 1./12.*RC3456pe
          );

      F13p4x23R +=  + Ab(m34,mu2) * ( 1./4. );

      F13p4x23R +=  + Ab(m35,mu2) * ( 1./4. );

      F13p4x23R +=  + Ab(m36,mu2) * ( 1./4. );

      F13p4x23R +=  + Ab(me2,mu2) * ( 1./6.*RSe45613p - 1./12.*
         RSe45633p - 1./12.*RSe45611p );

      F13p4x23R +=  + Ab(mp2,mu2) * ( 1./6.*RSp45613e - 1./12.*
         RSp45633e - 1./12.*RSp45611e );

      F13p4x23R +=  + Bb(m11,mu2) * (  - 1./12.*RD1456ep );

      F13p4x23R +=  + Bb(m33,mu2) * (  - 1./12.*RD3456ep );

  return F13p4x23R/pow(f0,2);
}

double fv2s3nf3p6(const quarkmassnf mass, const Linf Liin, const Ki Kiin){
  return fv2s3nf3p6L(mass,Liin)+fv2s3nf3p6K(mass,Kiin)+fv2s3nf3p6R(mass);
}

