double fv2s3nf3p6K(const quarkmassnf mass, const Ki Kiin){
  double KK[116],mu;
  Kiin.out(KK,mu);
  vector<double> B0mq;
  double f0,mu0;
  int nq;
  mass.out(B0mq,f0,mu0,nq);
  if (mu0 != mu){
    cout << "ERROR: differing mu's in fv2s3nf3p6L\n";}
  if ( (nq != 5) || (B0mq.size() != 5)){
    cout << "ERROR: fv2s3nf3p6K probably called with wrong number"
	 << "of quark masses\n";}
  // five masses: valence and sea quark mass
  double m11 = 2.*B0mq[0];
  double m33 = 2.*B0mq[1];
  double m44 = 2.*B0mq[2];
  double m55 = 2.*B0mq[3];
  double m66 = 2.*B0mq[4];

  double F13p6x23K =
       + KK[19] * ( 4*pow(m33,2) + 4*pow(m11,2) );

      F13p6x23K +=  + KK[20] * ( 4*m33*m66 + 4*m33*m55 + 4*m33*m44 + 4*
         m11*m66 + 4*m11*m55 + 4*m11*m44 );

      F13p6x23K +=  + KK[21] * ( 8*pow(m66,2) + 8*pow(m55,2) + 8*pow(
         m44,2) );

      F13p6x23K +=  + KK[22] * ( 8*pow(m66,2) + 16*m55*m66 + 8*pow(
         m55,2) + 16*m44*m66 + 16*m44*m55 + 8*pow(m44,2) );

      F13p6x23K +=  + KK[23] * ( 8*m11*m33 );

  return F13p6x23K/pow(f0,4);
}

